Synopsis

Tomura (Yosuke Eguchi) was once widely lauded as a legendary patissier, but some 8 years ago he inexplicably left the field.
Since that time, Tomura has lectured at culinary schools and wrote a guidebook for pastry critics.

Natsume (Yu Aoi) is a young woman who travels from Kagoshima to Tokyo to find her boyfriend. Natsume fins a job at &quot;Patisserie Coin de rue&quot;
- a pastry shop run by husband &amp; wife tandem Yuriko (Keiko Toda) and Julian (Nathan Berg).
At &quot;Patisserie Coin de rue&quot; Natsume works with talented patissier Mariko (Noriko Eguchi) &amp; her fascinating creations.

